import React from 'react';

const Checkout = () => {
  return (
    <div className="p-4">
      <h2 className="text-2xl mb-4">Checkout</h2>
      <p>Please complete your purchase!</p>
      <form className="mt-4">
        <input type="text" placeholder="Name" className="border p-2 mb-2 w-full" />
        <input type="text" placeholder="Address" className="border p-2 mb-2 w-full" />
        <input type="text" placeholder="Card Number" className="border p-2 mb-2 w-full" />
        <button type="submit" className="bg-blue-500 text-white p-2 w-full">
          Complete Purchase
        </button>
      </form>
    </div>
  );
};

export default Checkout;
